// src/pages/BrowseBooks.jsx
import React from "react";
import BookCard from "../components/BookCard";

const books = [
    {
        id: 1,
        title: "The Great Gatsby",
        description: "A novel by F. Scott Fitzgerald set in the Roaring Twenties.",
        image: "https://example.com/gatsby.jpg", // Replace with actual image URLs
        category: "Fiction",
    },
    {
        id: 2,
        title: "1984",
        description: "A dystopian novel by George Orwell.",
        image: "https://example.com/1984.jpg", // Replace with actual image URLs
        category: "Dystopian",
    },
    // Add more books here
];

const BrowseBooks = () => {
    return (
        <div className="min-h-screen bg-gray-100 py-10">
            <h2 className="text-3xl font-bold text-center mb-6">Browse Books</h2>
            <div className="flex flex-wrap justify-center">
                {books.map((book) => (
                    <BookCard key={book.id} book={book} />
                ))}
            </div>
        </div>
    );
};

export default BrowseBooks;
